package com.tb.test;

import java.io.IOException;
import java.util.ArrayList;
import java.util.List;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

import org.jsoup.Jsoup;
import org.jsoup.nodes.Document;
import org.jsoup.nodes.Element;
import org.jsoup.select.Elements;

public class Open {
	public static void main(String[] argv) {

		String url = "http://www.zgwj.gov.cn/upfile/template/contentpage/zgwj_zwgknew/xxgkdt.aspx?Itemtype=6&WebID=145&nodeID=3954";
		Document doc;
		try {
			doc = Jsoup
					.connect(url)
					.data("__EVENTTARGET",
							"AspNetPager1",
							"__EVENTARGUMENT",
							"1",
							"__VIEWSTATE",
							"",
							"__EVENTVALIDATION",
							"")
					.post();
			Elements tdList = doc.select("td[colspan=\"2\"]");
			// System.out.println(tdList.get(0));
			Elements trList = doc.select("a[href^=\"nry\"]");
			System.out.println(trList);

			Pattern pattern = Pattern
					.compile("(\">)(\\d\\d\\d\\d[^\\d].*?)(<)");
			Matcher matcher = pattern.matcher(tdList.toString());

			List<String> listMatches = new ArrayList<String>();

			while (matcher.find()) {
				listMatches.add(matcher.group(2));
			}

			for (String s : listMatches) {
				System.out.println(s);
			}

			String data = "";
			String part0 = "<a href=\"";
			String part1 = "\" class=\"dib fl ml12\">";
			String part2 = "</a> <span class=\"dib fr mr10\">";
			String part3 = "</span>";
			String zgwj = "http://www.zgwj.gov.cn/upfile/template/contentpage/zgwj_zwgknew/";

			for (int i = 0; i < 8; i++) {
				System.out.println(trList.get(i).attr("href"));
				System.out.println(trList.get(i).text());
				System.out.println(listMatches.get(i));

				data = part0 + zgwj + trList.get(i).attr("href") + part1
						+ trList.get(i).text() + part2 + listMatches.get(i)
						+ part3;
				System.out.println(data);

			}

		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
}
